      string: '{"model":"gpt-4o-2024-11-20","messages":[{"role":"system","content":"You
        are a bot that makes connections.\nPeople message you when they need something
        and whenever you feel you have enough information you let them know that you
        will be on the lookout for any users that can be of use to them.\nYou need
        enough detail about something before you can make a search so you can find
        someone that is a good match.\n"},{"role":"user","content":"We are now trying
        to find the best match for the searching user.\nGiven the user and two other
        users along with their conversation histories,\nreturn the user id of the
        best match for the searching user. return only a user_id.\nEven if both users
        are a poor match, return the best possible option.\n\n\n===========================\n\nExample
        response: 521\n\n\nsearching user\nUSER CONVERSATION\nuser id: 12\nuser first
        name: Kerry\n\n\ndate: 2024-11-28 20:02:23\nrole: user\ncontent: Hello\n\ndate:
        2024-11-28 20:02:23\nrole: assistant\ncontent: Hello! I''m a bot that can
        connect you to people. Tell me a little about what you''re looking for and
        I''ll try to find someone relevant to you.\n\n\ndate: 2024-11-28 20:02:23\nrole:
        user\ncontent: Seeking part-time dog walker in Brooklyn Heights for friendly
        golden retriever. Needed Monday-Wednesday afternoons, must be reliable and
        have references.\n\n\n\npossible match\nUSER CONVERSATION\nuser id: 4\nuser
        first name: Paula\n\n\ndate: 2024-11-28 20:02:20\nrole: user\ncontent: Hello\n\ndate:
        2024-11-28 20:02:20\nrole: assistant\ncontent: Hello! I''m a bot that can
        connect you to people. Tell me a little about what you''re looking for and
        I''ll try to find someone relevant to you.\n\n\ndate: 2024-11-28 20:02:20\nrole:
        user\ncontent: Teaching beginner pottery classes from my home studio in Portland.
        Small groups, all materials provided. Thursday evenings or Sunday afternoons.\n\n\n\npossible
        match\nUSER CONVERSATION\nuser id: 2\nuser first name: Ginny\n\n\ndate: 2024-11-28
        20:02:19\nrole: user\ncontent: Hello\n\ndate: 2024-11-28 20:02:19\nrole: assistant\ncontent:
        Hello! I''m a bot that can connect you to people. Tell me a little about what
        you''re looking for and I''ll try to find someone relevant to you.\n\n\ndate:
        2024-11-28 20:02:19\nrole: user\ncontent: Looking to join a fantasy football
        league in the Denver area. Experienced player, prefer in-person draft and
        weekly get-togethers to watch games.\n\n\n"}],"temperature":0.5,"store":true,"metadata":{"type":"comparison","environment":"test"}}'
